import React from "react";

function CarList(cart){
    return(
        <>
            <div>
                {
                    cart.map((cartItem, cartIndex)=>{
                        return(
                            <div>
                                <img src={cartItem.img} />
                                <span>{cartItem.name}</span>
                                <button> {CARI} </button>
                                <span> {cartItem.price} </span>
                            </div>
                        )
                    })
                }
            </div>
        </>
    )
}
export default CarList;
